import React from "react";
import "../../App.scss";
import TopBar from "../../components/TopBar/TopBar";
import Footer from "../../components/Footer/Footer";
import "./Contact.scss";

const Contact = () => {
  const sendRequest = async () => {
    try {
      const response = await fetch("http://localhost:8000/contact/", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({ message: "Hello from Contact Page" }),
      });

      if (!response.ok) {
        throw new Error("Network response was not ok");
      }
      const data = await response.json();
      console.log("Server response:", data);
    } catch (error) {
      console.error("Error sending request:", error);
    }
  };

  sendRequest();

  return (
    <>
      <div className="contact-page">
        <TopBar />
      </div>

      <main className="main main-contact">
        <section className="contact">
          <h1 className="contact-title">Contact us</h1>

          <div className="contact-content">
            <div className="contact-content__form">
              <form autoComplete="on" id="form" action="#" method="post" onSubmit={(e) => { e.preventDefault(); e.target.reset(); }} className="contact__message-form">
                <div className="contact__names">
                  <div className="user-name">
                    <label htmlFor="user-name" className="form__label">Name*</label>
                    <input type="text" id="user-name" className="form__input form__input--name form__input-item" name="user-name" placeholder="Enter your name" required />
                  </div>
                  <div className="company-name">
                    <label htmlFor="last-name" className="form__label">Last name*</label>
                    <input type="text" id="last-name" className="form__input form__input--companyName form__input-item" name="last-name" placeholder="Enter your last name" required />
                  </div>
                </div>
                <div className="contact__info">
                  <div className="contact__email">
                    <label htmlFor="user-email" className="form__label">Email*</label>
                    <input id="user-email" className="form__input form__input--email" type="email" name="email" placeholder="Enter your email" required />
                  </div>
                  <div className="contact__phone">
                    <label htmlFor="user-phone" className="form__label">Phone number*</label>
                    <input id="user-phone" className="form__input form__input--phone form__input-item" type="tel" name="phone" placeholder="Enter your phone number" required />
                  </div>
                </div>
                <div className="contact__message form__control">
                  <label htmlFor="user-message" className="form__label">Message*</label>
                  <textarea name="message" className="form__input input__textarea" placeholder="Enter your message" required></textarea>
                </div>
                <div className="contact__sent">
                  <div className="contact__policy">
                    <label className="contact__checkbox-label">
                      <input className="check-box" type="checkbox" required id="checkbox" />
                      <span className="contact__checkbox-text">I agree</span>
                    </label>
                  </div>
                  <div className="contact__button">
                    <button className="contact__text" type="submit">SUBMIT</button>
                  </div>
                </div>
              </form>
            </div>
          </div>
        </section>
      </main>
      <Footer />
    </>
  );
};

export default Contact;
